import React, { useState } from "react";
import Webcam from "react-webcam";
import { Brain, Database, PlayCircle, PlusCircle, BarChart3, Activity } from "lucide-react";

export default function Dashboard() {

  const [showCamera, setShowCamera] = useState(false);
  const [gestureName, setGestureName] = useState("");
  const [actionName, setActionName] = useState("");

  const token = localStorage.getItem("token");

  const retrainModel = async () => {
    try {
      const res = await fetch("http://127.0.0.1:8000/retrain_model", {
        method: "POST",
        headers: {
          "Authorization": `Bearer ${token}`
        }
      });

      const data = await res.json();

      if (res.ok) {
        alert("Model Retrained Successfully!");
      } else {
        alert(data.detail);
      }
    } catch (err) {
      alert("Error retraining model");
    }
  };

  const fetchFeatureMap = async () => {
    try {
      const res = await fetch("http://127.0.0.1:8000/extract_map", {
        headers: {
          "Authorization": `Bearer ${token}`
        }
      });

      const data = await res.json();
      console.log(data);
      alert("Feature map logged in console");
    } catch (err) {
      alert("Error fetching feature map");
    }
  };

  return (
    <div className="min-h-screen bg-[#0f172a] text-white px-6 py-10">

      <h1 className="text-4xl font-bold mb-10 text-center">Gesture Dashboard</h1>

      {/* Camera Section */}
      <div className="flex justify-center mb-10">
        <div className="relative w-full max-w-2xl aspect-video bg-slate-900 border border-slate-800 rounded-3xl flex items-center justify-center shadow-2xl overflow-hidden">

          {showCamera ? (
            <Webcam 
              audio={false}
              className="w-full h-full object-cover"
              mirrored={true}
            />
          ) : (
            <Activity size={80} className="text-blue-400 animate-pulse" />
          )}
        </div>
      </div>

      {/* Controls Grid */}
      <div className="grid md:grid-cols-3 gap-6">

        {/* Collect Data */}
        <div className="bg-slate-900 p-6 rounded-2xl border border-blue-500/20">
          <Database className="mb-4 text-blue-400"/>
          <h2 className="text-xl font-bold mb-3">Collect Data</h2>
          <input
            type="text"
            placeholder="Gesture Name"
            value={gestureName}
            onChange={(e) => setGestureName(e.target.value)}
            className="w-full bg-slate-800 p-2 rounded mb-3"
          />
          <input
            type="text"
            placeholder="Action Name"
            value={actionName}
            onChange={(e) => setActionName(e.target.value)}
            className="w-full bg-slate-800 p-2 rounded mb-3"
          />
          <button
            onClick={() => setShowCamera(true)}
            className="bg-blue-600 px-4 py-2 rounded w-full"
          >
            Start Collecting
          </button>
        </div>

        {/* Retrain Model */}
        <div className="bg-slate-900 p-6 rounded-2xl border border-green-500/20">
          <Brain className="mb-4 text-green-400"/>
          <h2 className="text-xl font-bold mb-3">Retrain Model</h2>
          <button
            onClick={retrainModel}
            className="bg-green-600 px-4 py-2 rounded w-full"
          >
            Retrain
          </button>
        </div>

        {/* Prediction */}
        <div className="bg-slate-900 p-6 rounded-2xl border border-purple-500/20">
          <PlayCircle className="mb-4 text-purple-400"/>
          <h2 className="text-xl font-bold mb-3">Start Prediction</h2>
          <button
            onClick={() => setShowCamera(true)}
            className="bg-purple-600 px-4 py-2 rounded w-full"
          >
            Predict
          </button>
        </div>

        {/* Feature Map */}
        <div className="bg-slate-900 p-6 rounded-2xl border border-yellow-500/20">
          <BarChart3 className="mb-4 text-yellow-400"/>
          <h2 className="text-xl font-bold mb-3">Feature Map</h2>
          <button
            onClick={fetchFeatureMap}
            className="bg-yellow-600 px-4 py-2 rounded w-full"
          >
            View Map
          </button>
        </div>

        {/* Accuracy (Placeholder) */}
        <div className="bg-slate-900 p-6 rounded-2xl border border-pink-500/20">
          <Activity className="mb-4 text-pink-400"/>
          <h2 className="text-xl font-bold mb-3">Model Accuracy</h2>
          <p className="text-gray-400">Coming Soon...</p>
        </div>

        {/* Add New Gesture */}
        <div className="bg-slate-900 p-6 rounded-2xl border border-blue-300/20">
          <PlusCircle className="mb-4 text-blue-300"/>
          <h2 className="text-xl font-bold mb-3">Add New Gesture</h2>
          <button
            onClick={() => alert("Use Collect Data Section")}
            className="bg-blue-400 px-4 py-2 rounded w-full"
          >
            Add Gesture
          </button>
        </div>

      </div>

    </div>
  );
}
